        string mode1 = "";
        mode1 = Context.Entity;

				bool available_part = false;
				decimal availqty = 0m;
				decimal availqty1 = 0m;

        /* mode1 = "Quote". */

        if (mode1 != "Quote")
        {
            /* Determine the FG mode to operate in */
            string assystockmodelookup = "";
            assystockmodelookup = PCLookUp.DataLookup("TBCAssembly_Stocking_Mode", "mode", "fgassy");

            /* Mode has been declared as Make Direct */
            if (Inputs.chk_makedirect.Value == true)
            {
                Inputs.chk_rework.Value = true;
                Inputs.var_configtype.Value = "MFG";
            }

						if (Inputs.chk_makedirect.Value == false)
						{
                Inputs.chk_rework.Value = false;
                /* Calculate the bool available_qty for the finished assembly */
                bool partrecordexists = false;
                string partrecordtype = "";

								string PartTypeCode = "";
								available_part = UDMethods.GetPartTypeCode(Context.CompanyID, Inputs.var_sku.Value, out PartTypeCode);
                if (available_part) {
                    partrecordexists = true;
                    partrecordtype = PartTypeCode;
                }

								if (partrecordexists == true)
								{
                    decimal qtyonhand = 0m;
                    decimal demandqty = 0m;

                    bool fromstock = false;

									Inputs.var_fgparttype.Value = partrecordtype;
										decimal OnHandQty;
										decimal DemandQty;

										/* Search for a FG Part record and calculate the bool available_qty's */
										bool available_PartQty = UDMethods.GetPartQty(Context.CompanyID, Inputs.var_sku.Value, out OnHandQty, out DemandQty);
										if (available_PartQty) {
												qtyonhand = OnHandQty;
												demandqty = DemandQty;
												availqty = qtyonhand - demandqty;
										}

                    /* Make Direct Mode Only */
                    if (assystockmodelookup == "NONE")
                    {
                        Inputs.chk_rework.Value = true;
                        Inputs.var_configtype.Value = "MFG";
                    }

                    /* only take fg assy from stock if the bool available_qty fulfills the full demand */
                    if (assystockmodelookup == "FULL")
                    {
                        if (availqty < Inputs.dec_soqty.Value) { fromstock = false; }
                        if (availqty == Inputs.dec_soqty.Value) { fromstock = true; }
                        if (availqty > Inputs.dec_soqty.Value) { fromstock = true; }

                         /* Manufactured Part Decision */
                        if (partrecordtype == "M")
                        {
                            if (fromstock == true) { Inputs.chk_rework.Value = false; }
                            if (fromstock == false) { Inputs.chk_rework.Value = true; }
                            /* Determine Config Type */
                            if (fromstock == true) { Inputs.var_configtype.Value = "M-STK"; }
                            if (fromstock == false) { Inputs.var_configtype.Value = "MFG"; }
                        }

                        if (partrecordtype == "P")
                        {
														/* Rqd due to a bug in CTP which ignores the sales release if a purchased part record exists */
                            if (fromstock == true) { Inputs.chk_rework.Value = false; }
                            if (fromstock == false) { Inputs.chk_rework.Value = false; }
                            /* Determine Config Type */
                            Inputs.var_configtype.Value = "PUR";
                        }

                         /* will take fg assy from stock even if the bool available_qty does not fulfill the full demand */
                        if (assystockmodelookup == "ANY")
                        {
                            if (availqty > 1) { fromstock = true; }
                            if (availqty == 0) { fromstock = false; }

                            /* Manufactured Part Decision */
                            if (partrecordtype == "M")
                            {
                                if (fromstock == true) { Inputs.chk_rework.Value = false; }
                                if (fromstock == false) { Inputs.chk_rework.Value = true; }
                                /* Determine Config Type */
                                if (fromstock == true) { Inputs.var_configtype.Value = "M-STK"; }
                                if (fromstock == false) { Inputs.var_configtype.Value = "MFG"; }
                            }

                            if (partrecordtype == "P")
                            {
																/* Rqd due to a bug in CTP which ignores the sales release if a purchased part record exists */;
                                if (fromstock == true) { Inputs.chk_rework.Value = false; }
                                if (fromstock == false) { Inputs.chk_rework.Value = false; }
                                /* Determine Config Type */
                                Inputs.var_configtype.Value = "PUR";
                            }
                        }
										}
								}

                if (partrecordexists == false)
                {
                    Inputs.chk_rework.Value = true;
                    /* Determine Config Type */
                    Inputs.var_configtype.Value = "MFG";
                }
						}
				}

        /* **************************************************************************************** */

        /* Keyed in the quote environment and set as Make Direct from Components only */
        if (mode1 == "Quote")
        {
            Inputs.chk_rework.Value = true;
            Inputs.var_configtype.Value = "MFG";
        }

        /* **************************************************************************************** */

        if (Inputs.chk_rework.Value == false)
        {
            string assystring = "";
            assystring = Inputs.dec_soqty.Value.ToString() + " x " + Inputs.var_smart2.Value + " will be taken from bool available_stock of " + availqty.ToString() + ".";
            Inputs.var_fgvalidity.Value = assystring;

            /* Update BOM FG Part */
            Inputs.var_fgstockpart.Value = Inputs.var_sku.Value;
            Inputs.var_subcasspart.Value = "";

            /* Configure unwanted BOM parts */
            Inputs.var_bomvalidity.Invisible = true;
            Inputs.var_subcasspart.Invisible = true;
            Inputs.var_casstkavail.Invisible = true;
            Inputs.var_bomstatus.Invisible = true;
            Inputs.var_weightlookup.Invisible = true;
            Inputs.var_cassettepartnum.Invisible = true;
            Inputs.var_wedgepartnum.Invisible = true;
            Inputs.var_webpartnum.Invisible = true;
            Inputs.var_tapeendpartnum.Invisible = true;
            Inputs.var_topcappartnum.Invisible = true;
            Inputs.var_dustcoverpart.Invisible = true;
            Inputs.var_cassetteqty.Invisible = true;
            Inputs.var_wedgeqty.Invisible = true;
            Inputs.var_webqty.Invisible = true;
            Inputs.var_tapeendqty.Invisible = true;
            Inputs.var_topcapqty.Invisible = true;
            Inputs.var_dustcoverqty.Invisible = true;

            Inputs.var_cassettepartnum.Value = "";
            Inputs.var_wedgepartnum.Value = "";
            Inputs.var_webpartnum.Value = "";
            Inputs.var_tapeendpartnum.Value = "";
            Inputs.var_topcappartnum.Value = "";
            Inputs.var_dustcoverpart.Value = "";
            Inputs.var_dustcoverpart.Value = "";
            Inputs.var_cassetteqty.Value = 0;
            Inputs.var_wedgeqty.Value = 0;
            Inputs.var_webqty.Value = 0;
            Inputs.var_tapeendqty.Value = 0;
            Inputs.var_topcapqty.Value = 0;
            Inputs.var_dustcoverqty.Value = 0;
				}


        if (Inputs.chk_rework.Value == true)
        {
            Inputs.var_fgvalidity.Value = "Make Direct";
            Inputs.var_bomstatus.Invisible = false;
            Inputs.var_weightlookup.Invisible = false;
            Inputs.var_bomvalidity.Invisible = false;

            /* Update BOM FG Part */
            Inputs.var_fgstockpart.Value = "";

            if ((Inputs.var_bomstatus.Value == "** ERROR ** A component in the BOM has no Epicor Part Master Record.") && (Inputs.chk_erroron.Value == true))
            {
								MessageBox.Show("A Component in the BOM does not exist in the Parts Master table, or the record has been made inactive. Please contact the Operations department to resolve this issue.", "Error", MessageBoxButtons.OK,  MessageBoxIcon.Exclamation);
								PageLeaveFunctions.SetNextInputPage(5);

            }
				}


        /* **************************************************************************************** */

        /* Calculates Net Weight */

        decimal CompWeight1 = 0m;
        decimal CompWeight2 = 0m;
        decimal CompWeight3 = 0m;
        decimal CompWeight4 = 0m;
        decimal CompWeight5 = 0m;
        decimal CompWeight6 = 0m;
        decimal CompWeight7 = 0m;

				decimal PartWeight = 0m;

        if (Inputs.var_cassettepartnum.Value != "")
        {
            available_part = UDMethods.GetPartWeigh(Context.CompanyID, Inputs.var_cassettepartnum.Value, out PartWeight);
        }
        if (available_part) {
            CompWeight1 = PartWeight * Inputs.var_cassetteqty.Value;
        }

        if (Inputs.var_wedgepartnum.Value != "")
        {
            available_part = UDMethods.GetPartWeigh(Context.CompanyID, Inputs.var_wedgepartnum.Value, out PartWeight);
        }
        if (available_part) {
            CompWeight2 = PartWeight * Inputs.var_wedgeqty.Value;
        }

        if (Inputs.var_webpartnum.Value != "")
        {
            available_part = UDMethods.GetPartWeigh(Context.CompanyID, Inputs.var_webpartnum.Value, out PartWeight);
        }
        if (available_part) {
            CompWeight3 = PartWeight * Inputs.var_webqty.Value;
        }

        if (Inputs.var_tapeendpartnum.Value != "")
        {
            available_part = UDMethods.GetPartWeigh(Context.CompanyID, Inputs.var_tapeendpartnum.Value, out PartWeight);
        }
        if (available_part) {
            CompWeight4 = PartWeight * Inputs.var_tapeendqty.Value;
        }

        if (Inputs.var_topcappartnum.Value != "")
        {
            available_part = UDMethods.GetPartWeigh(Context.CompanyID, Inputs.var_topcappartnum.Value, out PartWeight);
        }
        if (available_part) {
            CompWeight5 = PartWeight * Inputs.var_topcapqty.Value;
        }

        if (Inputs.var_dustcoverpart.Value != "")
        {
            available_part = UDMethods.GetPartWeigh(Context.CompanyID, Inputs.var_dustcoverpart.Value, out PartWeight);
        }
        if (available_part) {
            CompWeight6 = PartWeight * Inputs.var_dustcoverqty.Value;
        }

        if ((Inputs.chk_rework.Value == false) && (Inputs.var_smart2.Value != ""))
        {
            available_part = UDMethods.GetPartWeigh(Context.CompanyID, Inputs.var_smart2.Value, out PartWeight);
            if (available_part) {
                Inputs.var_netweight.Value = PartWeight * 1;
            }
        }

        /* Totals the individual component weights if make direct */
        if (Inputs.chk_rework.Value == true)
        {
            Inputs.var_netweight.Value = CompWeight1 + CompWeight2 + CompWeight3 + CompWeight4 + CompWeight5 + CompWeight6 + CompWeight7;

            /* Used to display Netweight list incase verification is required */
            Inputs.var_weightlookup.Value = "1(" + CompWeight1.ToString() + ")" + " - 2(" + CompWeight2.ToString() + ")" + " - 3(" + CompWeight3.ToString() + ")" + " - 4(" + CompWeight4.ToString() + ")" + " - 5(" + CompWeight5.ToString() + ")" + " - 6(" + CompWeight6.ToString() + ")" + " - 7(" + CompWeight7.ToString() + ")";
        }

        /* Set the default Operation */
        if (Inputs.chk_rework.Value == false)
        {
            Inputs.var_optouse.Value = Inputs.var_op1.Value;
        }

        if ((Inputs.chk_rework.Value == true) && (Inputs.var_fgstockpart.Value == ""))
        {
            Inputs.var_optouse.Value = Inputs.var_op1.Value;
        }

        if (Inputs.var_fgstockpart.Value != "")
        {
            Inputs.var_optouse.Value = PCLookUp.DataLookup("TBCCassetteRange", "fromstock_oper_code", Inputs.cmb_cassetteselection.Value);
        }
